import React, { Component } from 'react';
import Navbar from './component/Navbar'
import { BrowserRouter, Route } from 'react-router-dom'
import Home from './component/Home'

class App extends Component {
  render(){
    return (
      <BrowserRouter>
        <div className="App">
          <Navbar />
          <Route path='/' component={Home} />
        </div>
      </BrowserRouter>
    );
  }
}

export default App;
